    return (
        <div style={{position:'sticky'}}>

        <Flex bg={'white'} height='50px' padding='5px 10px' align={'center'}>
           <Flex width={'70px'} justify={'center'} align={'center'}>
                <Image src="./logo192.png" height={'50px'}/>
           </Flex>
           <Search/>
           <RightBlock />
        </Flex>
        </div>
    )
}
